const AddMealsForm = function () {

    return (
      <form >
        <span> Amount </span> 
        <input type="number" min="1" max="5" step="1" defaultValue="1" />
       <div> <button>+ Add</button></div>
      </form>
    );
};


export default AddMealsForm;
